INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "リリ", 40011, 321, 24001, 1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 2, 0);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "クリア", 40011, 322, 24001, 2, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 2, 0);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "プレシア", 40011, 323, 24001, 3, 1, "んーと。\nこれ、あげる。\nはい", 126101, 2, 0);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "リリ", 40011, 324, 24001, 4, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 2, 0);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "クリア", 40011, 325, 24001, 5, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 2, 0);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "プレシア", 40011, 326, 24001, 6, 2, "お兄。\nきてくれて、うれしい", 126101, 2, 0);
